description:
When a lab assistant steals an important formula and all its documentation from Dr. Whitman, he hires a bottom-of-the-barrel private eye, Chase Barr, to locate it. When Barr digs deeper into the case he finds the lab assistant is actually a dead street whore and the &quot;formula&quot; is a reanimation agent that, with the consumption of human blood, is keeping her alive! In trying to retrieve the formula, Chase is given a rollercoaster ride through hell as the whore reanimates corpses to attack him and help her hold onto the formula.


